pragma solidity ^0.5.11;

import "./OraclizeContracts.sol";


contract Ownable {
    address payable public  owner;

    event OwnershipRenounced(address indexed previousOwner);
    event OwnershipTransferred(
        address indexed previousOwner,
        address indexed newOwner
    );

    constructor() public {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Permission denied!");
        _;
    }

    function transferOwnership(address payable newOwner ) public onlyOwner {
        require(newOwner != address(0), "Address is not valid!");
        emit OwnershipTransferred(owner, newOwner);
        owner = newOwner;
    }
}


contract Enableble is Ownable{

    bool enable;

    modifier isWorking() {
        require(enable, "Not working!");
        _;
    }

    function setEnable (bool newStatus) public onlyOwner {
        enable = newStatus;
    }
}


contract LiveDouble is Enableble, usingOraclize {


    
    // TODO: must be false at testnet or mainnet
    bool public development=true;

    uint256 public oraclizeGasLimit = 300000;
    uint256 public minRounDuration = 1;
    uint256 public minDeposit = 1;
    address payable public commissionWalet;
    uint256 public commissionPercent = 100;//100 = 10%, 150=15%
    uint256 public percentMax = 1000;
    uint256 public ticketPrice = 0.001 ether;
    uint256 public maxTotalJp = 0;
    bool public drawInProcess = false;

    struct User {
        bool isExist;
        uint256 balance;
        uint256 depositTotal;
        uint256 winTotal;
        uint256 gamesTotal;
    }
    mapping(address => User) public userAccounts;
    address[] users;

    struct Round {
        uint256 ticketsTotal;
        uint256 ticketPrice;
        uint256 startBlock;
        uint256 endBlock;
        uint256 winnerIndex;
        address payable[]  users;
        mapping(address => uint256)  tickets;
    }
    uint256 public currentRoundNumber;
    Round[] public rounds;

    event Deposit(address indexed player, uint value, uint256 tickets, uint deposited);
    event Withdraw(address indexed player, uint value);
    event StartDraw(uint256 roundNumber);
    event EndDraw(uint256 roundNumber, address payable winner, uint prize);

    event Error(string message);

    modifier isOpen() {
        require(drawInProcess == false, "Game is drawing!");
        _;
    }

    constructor (bool isDevelopmentNetwork) payable public{
        development = isDevelopmentNetwork;
        commissionWalet = msg.sender;
        //      1
        currentRoundNumber -= 1;
        createRound();
        enable = true;
    }

    function () external payable {}

    //    
    function deposit() public isWorking isOpen payable {
        Round storage currentRound = rounds[currentRoundNumber];

        // -   
        uint ticketToPurchaze = msg.value / currentRound.ticketPrice;
        //    
        uint unusedDeposit = msg.value % currentRound.ticketPrice;

        User storage user = userAccounts[msg.sender];
        if (!user.isExist){
            // 
            user.isExist = true;
            users.push(msg.sender);
        }
        //     
        user.balance += unusedDeposit;
        user.depositTotal += msg.value;

        if (ticketToPurchaze>0) {
            currentRound.ticketsTotal += ticketToPurchaze;
            //      ,    
            if (currentRound.tickets[msg.sender]==0){
                currentRound.users.push(msg.sender);
                user.gamesTotal++;
            }
            //  -  
            currentRound.tickets[msg.sender] += ticketToPurchaze;

            emit Deposit(msg.sender, msg.value, ticketToPurchaze, ticketToPurchaze*currentRound.ticketPrice);

            startDraw();
        }

    }

    //    ,     
    //   ,         
    function startDraw() public isWorking {
        if (block.number - rounds[currentRoundNumber].startBlock > minRounDuration && rounds[currentRoundNumber].users.length>=2){
            drawInProcess = true;
            rounds[currentRoundNumber].endBlock = block.number;

            if (!development){
                callOracleRandom();
            }
            emit StartDraw(currentRoundNumber);
        }
    }

    //      
    function callOracleRandom() internal {
        oraclize_setProof(proofType_Ledger); // sets the Ledger authenticity proof
        uint N = 16; // number of random bytes we want the datasource to return
        uint delay = 0; // number of seconds to wait before the execution takes place
        // this function internally generates the correct oraclize_query and returns its queryId
        oraclize_newRandomDSQuery(delay, N, oraclizeGasLimit);
    }

    //  ,     ,        
    function endDraw(uint256 seed) internal {
        //     
        require(drawInProcess == true, "Draw not in process!");

        Round storage currentRound = rounds[currentRoundNumber];
        uint randomTicket = seed % currentRound.ticketsTotal;
        uint256 ticketsCounter = 0;
        //       
        for (uint256 i = 0; i < currentRound.users.length; i++){
            if (randomTicket < currentRound.tickets[currentRound.users[i]] + ticketsCounter){
                currentRound.winnerIndex = i;
                break;
            }
            ticketsCounter += currentRound.tickets[currentRound.users[i]];
        }

        address payable winnerAddress = currentRound.users[currentRound.winnerIndex];
        uint256 totalPrize = currentRound.ticketsTotal * currentRound.ticketPrice;
        uint256 commissionValue = totalPrize * commissionPercent / percentMax;
        uint256 winnerPrize = totalPrize - commissionValue;

        if (totalPrize>maxTotalJp) {
            maxTotalJp = totalPrize;
        }
        userAccounts[winnerAddress].winTotal += totalPrize;
        //   ,  ,  -  
        if (!winnerAddress.send(winnerPrize)){
            userAccounts[winnerAddress].balance += winnerPrize;
        }
        if (!commissionWalet.send(commissionValue)){
            userAccounts[commissionWalet].balance += commissionValue;
        }
        emit EndDraw(currentRoundNumber, winnerAddress, totalPrize);
        //  
        createRound();
        //   
        drawInProcess = false;

    }

    //    
    function __callback(bytes32 _queryId, string memory  _result, bytes memory _proof) public {
        require (msg.sender == oraclize_cbAddress(), "oraclize only");
        if (oraclize_randomDS_proofVerify__returnCode(_queryId, _result, _proof) != 0) {
            // the proof verification has failed, do we need to take any action here? (depends on the use case)
            emit Error("proof verification has failed");
        } else {
            endDraw(uint(keccak256(abi.encode(_result))));
        }
    }

    function createRound() internal {
        currentRoundNumber += 1;
        Round memory newRound = Round(0,0,0,0,0, new address payable[](0));
        newRound.startBlock = block.number;
        newRound.ticketPrice = ticketPrice;
        rounds.push(newRound);
    }

    //     
    function withdraw() public isWorking {
        uint256 value = userAccounts[msg.sender].balance;
        require(address(this).balance>=value, "TODO: oom label");
        userAccounts[msg.sender].balance = 0;
        msg.sender.transfer(value);
    }

    //   ----------------------
    //      
    function ownerEndDraw(uint256 seed) public onlyOwner {
        endDraw(seed);
    }

    function ownerWithdraw(uint256 value) public onlyOwner {
        require(address(this).balance>=value, "TODO: oom label");
        owner.transfer(value);
    }

    function setMinRounDuration(uint256 newValue) public onlyOwner {
        minRounDuration = newValue;
    }

    function setMinDeposit(uint256 newValue) public onlyOwner {
        minDeposit = newValue;
    }

    function setCommissionWalet(address payable newValue) public onlyOwner {
        commissionWalet = newValue;
    }

    function setCommissionPercent(uint256 newValue) public onlyOwner {
        commissionPercent = newValue;
    }

    function setOraclizeGasLimit(uint256 newValue) public onlyOwner {
        oraclizeGasLimit = newValue;
    }

    //       (     )
    function setTicketPrice(uint256 newValue) public onlyOwner {
        ticketPrice = newValue;
    }

    function getPlayerTicketsCount(address player, uint256 roundNumber) public view returns(uint256) {
        return rounds[roundNumber].tickets[player];
    }

    function getTotalPlayerCount() public view returns(uint256) {
        return users.length;
    }

    function getCurrentJp() public view returns(uint256) {
        //currentRound.ticketsTotal * currentRound.ticketPrice
        return rounds[currentRoundNumber].ticketsTotal*rounds[currentRoundNumber].ticketPrice;
    }
}
